__NUXT_JSONP__("/drugs/Interferon_Alfa-N3", (function(a,b,c,d){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"9008-11-1",chebiId:b,chemicalFormula:b,definition:"A formulated therapeutic analog of the endogenous alpha interferon containing multiple interferon species with antiviral and antitumor properties.  Interferons bind to specific cell-surface receptors, leading to the transcription and translation of genes with an interferon-specific response element, thereby inducing: antiviral effects (the most important being inhibition of viral protein synthesis); antiproliferative effects (including inhibition of cellular growth and alteration of cellular differentiation); anticancer effects (including interference with oncogene expression); and immune-modulating effects (including activation of natural killer cells, alteration of cell surface antigen expression, and augmentation of lymphocyte and macrophage cytotoxicity).",fdaUniiCode:"47BPR3V3MP",identifier:"C30136",preferredName:c,semanticType:"Amino Acid, Peptide, or Protein",subclassOf:["C225"],synonyms:["Alfa-N3 Interferon","Alferon N","Altemol","INTERFERON ALFA-N3","Interferon Alfa-3N, Human Leukocyte Derived",c]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FInterferon_Alfa-N3",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("Interferon_Alfa-N3","","Interferon Alfa-N3","2021-10-30T13:39:11.963Z")));